import React from 'react';
import StationInfo from './StationInfo'
import SearchBarWrapper from '../containers/SearchBarWrapper'
import { SEARCH_PANEL } from '../actions'




const StationPanel = ( {stationArray, panel} ) => (
	<div>
		{ panel === SEARCH_PANEL && <SearchBarWrapper /> }
		{stationArray.map(s => <StationInfo key={s.id} {...s}/>)}

	</div>
) 


export default StationPanel;
